<template>
  <div class="ce-shi">
    <van-nav-bar title="app方法测试" left-text left-arrow class="navbar" @click-left="toBack" />
    <div>
      <van-field v-model="phone" label="手机号" placeholder="请输入手机号" />
      <van-button type="info" size="large" @click="toPhone">拨打电话</van-button>
    </div>
    <div>
      <van-field v-model="str" label="复制" placeholder />
      <van-button type="info" size="large" @click="copy">复制</van-button>
    </div>
    <div>
      <van-field v-model="img" label="下载图片Ios" placeholder />
      <van-button type="info" size="large" @click="uploadIos">下载图片Ios</van-button>
      <van-field v-model="img1" label="下载图片安卓" placeholder />
      <van-button type="info" size="large" @click="upload">下载图片安卓</van-button>
    </div>
    <div>
      <div>
        <p>videoId: {{videoId}}</p>
        <p>object: {{object}}</p>
      </div>
      <van-button type="info" size="large" @click="shootVideo">录制视频</van-button>
    </div>
    <div>
      <van-field v-model="title" label="标题" placeholder />
      <van-field v-model="links" label="链接" placeholder />
      <van-button type="info" size="large" @click="share">分享</van-button>
    </div>
    <div>
      <van-field v-model="latitude" label="latitude" placeholder />
      <van-field v-model="longitude" label="longitude" placeholder />
      <van-button type="info" size="large" @click="getLatitudeLongitude">导航</van-button>
    </div>
    <div>
      <div>
        <p>latitude1: {{latitude1}}</p>
        <p>longitude1: {{longitude1}}</p>
      </div>
      <van-button type="info" size="large" @click="getJwd">获取经纬度</van-button>
    </div>
    <div>
      <van-field v-model="url" label="淘宝地址" placeholder />
      <van-button type="info" size="large" @click="goTb">打开淘宝</van-button>
    </div>
  </div>
</template>

<script>
import { Field } from "vant";
export default {
  name: "ce-shi",
  data() {
    return {
      phone: "18888888888",
      str: "测试复制",
      img:
        "https://inexweb.oss-cn-shenzhen.aliyuncs.com/yunpt/resource/image/banner/201909/a6d39dfe87e9030823130ed13013d4e6.jpg",
      img1:
        "data:image/png;base64,",
      videoId: "",
      object: "",
      title: "测试分享标题",
      links: location.href,
      latitude: 26.053776,
      longitude: 119.341393,
      latitude1: "",
      longitude1: "",
      url: "http://item.taobao.com/item.htm?id=589345775798"
    };
  },
  components: {
    [Field.name]: Field
  },
  created() {},
  mounted() {
    window.vue = this;
  },
  methods: {
    goTb() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.goTb(this.url);
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    getJwd() {
      try {
        // eslint-disable-next-line no-undef
        this.latitude1 = ykAPP.getLatitude();
        // eslint-disable-next-line no-undef
        this.longitude1 = ykAPP.getlongitude();
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    getLatitudeLongitude() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.getLatitudeLongitude(this.latitude, this.longitude);
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    share() {
      try {
        // eslint-disable-next-line no-undef
        this.$fnc.appShare(
          this.title,
          this.title,
          this.links,
          this.links
        );
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    upvideo(videoId, object) {
      this.videoId = videoId;
      this.object = object;
    },
    shootVideo() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.shootVideo();
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    toPhone() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.phone(this.phone);
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    copy() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.copy(this.str);
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    uploadIos() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.downImage(this.img);
      } catch (error) {
        this.$toast("请在app打开");
      }
    },
    upload() {
      try {
        // eslint-disable-next-line no-undef
        ykAPP.downBase64Image(this.img1);
      } catch (error) {
        this.$toast("请在app打开");
      }
    }
  }
};
</script>
